import React, { useEffect, useState } from "react";
import axios from "axios";

const App = () => {
  const [data, getData] = useState();
  const getApiData = async () => {
    const { data } = await axios.get(
      `https://thesimpsonsquoteapi.glitch.me/quotes?count=50`
    );
    getData(data);
  };
  useEffect(() => {
    getApiData();
  }, []); // Only runs once
  return <></>;
};

export default App;
